import { RootState } from "../store/reducer/rootReducer";
import { useSelector } from "react-redux";
import { Grid, Card, CardActionArea, CardMedia, CardContent, Typography, CardActions, Button } from "@material-ui/core";
import classes from "*.module.css";
import { CATEGORY } from "../utils/contants";

export const List = () => {
    const product = useSelector((state: RootState) => state.product);
    const { data } = product;
    return (
        <Grid item container direction="row" justify="space-between" className={classes.rootContainer}>
            {data.length && data.map((item: any, index: number) => (
                <Grid item xs={4} className={classes.root} key={'cat' + index}>
                    <Card className={classes.root}>
                        <CardActionArea>
                            <CardMedia
                                className={classes.media}
                                image={item.image}
                                title="Contemplative Reptile"
                            />
                            <CardContent>
                                <Typography gutterBottom variant="h5" component="h2">
                                    Lizard
          </Typography>
                                <Typography variant="body2" color="textSecondary" component="p">
                                    Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                                    across all continents except Antarctica
          </Typography>
                            </CardContent>
                        </CardActionArea>
                        <CardActions>
                            <Button size="small" color="primary">
                                Share
        </Button>
                            <Button size="small" color="primary">
                                Learn More
        </Button>
                        </CardActions>
                    </Card>
                </Grid>
            ))}
        </Grid>
    )
}
export default List;
